CREATE DEFINER=`root`@`localhost` PROCEDURE `getDataToBeSanitized1`(IN `rowStart` INT(11), IN `rowCount` INT(11))
BEGIN
	SET @rowStart = rowStart;
    SET @rowCount = rowCount;

    SET @s = "SELECT SQL_CACHE raw_id, raw_doctor, raw_license, raw_branchcode FROM sanitation_result_new WHERE raw_status = '' AND raw_corrected_name = '' ORDER BY raw_date DESC LIMIT ?, ?";
    PREPARE stmt FROM @s;
    EXECUTE stmt USING @rowStart, @rowCount;
    DEALLOCATE PREPARE stmt;
END

CREATE DEFINER=`root`@`localhost` PROCEDURE `getDoctorByName2`(IN `mdName` VARCHAR(255), IN `clauseCols` VARCHAR(255))
BEGIN
    SET @s = CONCAT('SELECT sanit_id, sanit_mdname, sanit_license, sanit_group, sanit_universe, sanit_mdcode FROM db_sanitation2 WHERE ', clauseCols, '= ',QUOTE(mdName));
    PREPARE stmt FROM @s;
    EXECUTE stmt;
    DEALLOCATE PREPARE stmt;
END

